int OpenComm()
{
//	hDevice = open("/dev/ttyS0", O_RDWR | O_NONBLOCK);// | O_SYNC | O_NOCTTY);
	hDevice = open("/dev/ttyUSB0", O_RDWR | O_NONBLOCK);// | O_SYNC | O_NOCTTY);
	if (hDevice < 0)
	{
		printf("OpenComm open hDevice<0\n");
		return -1;
	}

	struct termios opt;
	memset(&opt, 0, sizeof(opt));
	nRet = tcgetattr(hDevice, &opt);
	if (nRet < 0)
	{
		printf("OpenComm tcgetattr nRet=%d\n", nRet);
		return -2;
	}

	opt.c_iflag &= ~(IGNBRK | BRKINT | PARMRK | ISTRIP | ICRNL | INLCR | IXON | IXOFF | IXANY | IGNCR); 
	opt.c_oflag &= ~OPOST;
	opt.c_lflag &= ~(ECHO | ECHONL | ICANON | ISIG | IEXTEN);
	opt.c_cflag |= CLOCAL | CREAD;

//	cfsetispeed(&opt, B9600);
//	cfsetospeed(&opt, B9600);

	cfsetispeed(&opt, B115200);
	cfsetospeed(&opt, B115200);

	opt.c_cflag &= ~CSIZE;
	opt.c_cflag |= CS8;

//	opt.c_cflag &= ~PARENB;
//	opt.c_iflag &= ~INPCK;

//	opt.c_cflag &= ~CSTOPB;

	opt.c_cflag &= ~CRTSCTS;
	
	opt.c_cc[VTIME] = 50;  //1分秒=0.1秒
	opt.c_cc[VMIN] = 0;

	tcflush(hDevice, TCIOFLUSH);

	nRet = tcsetattr(hDevice, TCSANOW, &opt);
	if (nRet != 0)
	{
		printf("OpenComm tcsetattr nRet=%d\n", nRet);
		return -3;
	}

	return 0;
}

int CloseComm()
{	
	if (hDevice != -1)
		close(hDevice);

	hDevice = -1;	

	return 0;
}

int SendCommData(unsigned char* buffer, int dwBytesWritten)
{
	tcflush(hDevice, TCIOFLUSH);
	
	for (int i=0; i<dwBytesWritten; i++)
	{	
		nRet = write(hDevice, &buffer[i], 1);
		if (nRet != 1)
			return -1;
		
		//printf("Send:%d:%d\n", i, buffer[i]);
	}	
	
	//printf("Send OK :%d\n", dwBytesWritten);
	return dwBytesWritten;
}
int RecvCommData(unsigned char* buffer, int dwBytesRead )
{
	int RecvBytes;
	fd_set fds;
	struct timeval TimeOut = {0, 1000000}; //2秒

	for (RecvBytes=0; RecvBytes<dwBytesRead; RecvBytes++)
	{
		FD_ZERO(&fds);
		FD_SET(hDevice, &fds);
		nRet = select(hDevice+1, &fds, 0, 0, &TimeOut);
		if (nRet < 0)
			return -1;
		if (nRet == 0)
			return -2;	

		nRet = read(hDevice, buffer+RecvBytes, 1);
		if (nRet != 1)
			return -3;				
	}
	
	return dwBytesRead;
}
unsigned char SumCheck(unsigned char * bData,int nLen)
{
	unsigned char bRet = 0;
	for(int n = 0 ; n < nLen ; n++)
	{
		bRet =  bRet ^ bData[n]; 
	}
	return bRet;
}
int SAM_FindCard(unsigned char * pucIIN)	
{
	unsigned char cSendData[16] = {0};
        unsigned char cRecvData[16] = {0};
	int nSize = 10;
	int nLen = 0;
	int nSend,nDataLen,nCheckLen;
	unsigned char uCheck;
	cSendData[0] = 0XAA;
	cSendData[1] = 0XAA;
	cSendData[2] = 0XAA;
	cSendData[3] = 0X96;
	cSendData[4] = 0X69;
	cSendData[5] = 0X00;
	cSendData[6] = 0X03;
	cSendData[7] = 0X20;
	cSendData[8] = 0X01;
	
	cSendData[9] = SumCheck(&cSendData[5],4);
	
	//printf("SAM_FindCard Send:%x", cSendData);
	
	tcflush(hDevice, TCIOFLUSH);

	nSend = SendCommData(cSendData,nSize);
	if (nSend == nSize)
	{
		nLen = RecvCommData(cRecvData,7) ;	// 数据头5字节,数据长度2字节
		nDataLen = cRecvData[5]*256 + cRecvData[6];	
		nLen = RecvCommData(&cRecvData[7],nDataLen);	// 剩余数据,包括校验
		//printf("SAM_FindCard Recv:%s", cRecvData);
		nLen = nLen + 7;
		nCheckLen = 2 + nDataLen -1;
		uCheck = SumCheck(&cRecvData[5],nCheckLen);
		if (cRecvData[9] == 0X9F)
		{
			if( cRecvData[nDataLen + 6] == uCheck )
			{
				memcpy(pucIIN,&cRecvData[10],4);
				nRet = 0;
			}
			else
			{
				nRet = -2;
			}
		}
		else
		{
			nRet = -1;
		}
	}
	else
	{
		nRet = -3;
	}
	return nRet;
}

