char * trimright(char * str)
{
    int i = strlen(str)-1;
    while (i>0)
    {
        if (str[i]==' ')
            str[i--] = '\0';
        else
            break;
    }

    return str;
}

int WideCharToMultiByte(unsigned short * lpWideCharStr, int cchWideChar,
                        char * lpMultiByteStr, int cchMultiByte)
{
    
    int i,ccb;
    for (i=0,ccb=0; i<cchWideChar; i++)
    {
        if (lpWideCharStr[i]<256)
        {
            if (ccb==cchMultiByte-1)
    	        return ccb;
            lpMultiByteStr[ccb++] = (char)lpWideCharStr[i];
        }
    	else
    	{
            if (ccb==cchMultiByte-2)
                return ccb;
            lpMultiByteStr[ccb++] = UNICODE_TO_GB2312[lpWideCharStr[i]%256][lpWideCharStr[i]/256][0];
            lpMultiByteStr[ccb++] = UNICODE_TO_GB2312[lpWideCharStr[i]%256][lpWideCharStr[i]/256][1];
        }
    }
    return ccb;
}

int ReadCard()
{
	nRet = OpenComm();
	if (nRet != 0)
	{
		printf("ReadCard OpenComm nRet=%d\n", nRet);
		return -1;
	}

	nRet = SAM_FindCard(pucIIN);
	if (nRet != 0)
		printf("SAM_FindCard nRet=%d\n", nRet);
	nRet = SAM_SelectCard(pucSN);
	if (nRet != 0)
		printf("SAM_SelectCard nRet=%d\n", nRet);
	nRet = SAM_ReadBaseMsg(pucBaseMsg, pucPhoto);
	if (nRet != 0)
	{
		CloseComm();
		printf("SAM_ReadBaseMsg nRet=%d\n", nRet);
		return -1;
	}

	CloseComm();

	return 0;
}

